  false,\n\t\"url\": null,\n\t\"notes\": \"This layer represents boundaries for New
  Mexico's gross receipts tax districts as identified on the \"Gross Receipts Tax
  Rate Schedule\" published by the Taxation and Revenue Department. Initial municipal
  boundaries acquired from RGIS and based on layers developed by the Earth Data Analysis
